import { Container } from "react-bootstrap";
function Footer() {
  return (
    <>
      <Container>
        <a
          href="https://portfolio-polu-sai-ashish.web.app/"
          target="_blank"
          rel="noreferrer"
          style={{
            textDecoration: "none",
            color: "white",
          }}
        >
          About me
        </a>
      </Container>
      <section
        style={{
          bottom: "0",
          width: "100%",
          backgroundColor: "#2C3539",
          color: "#fff",
          textAlign: "center",
          padding: "10px",
        }}
      >
        <Container>
          <p>Copyright @ All Rights Reserved</p>
        </Container>
        <Container>
          <p>Designed and Developed by Ashish</p>
          <p>React JS and Bootstrap hosted on firebase</p>
        </Container>
      </section>
    </>
  );
}
export default Footer;
